class Solution:
    def getListOfFactors(self, num: int) -> set:
        s = set()

        if num <= 1:
            return s

        while(num % 2 == 0):
            s.add(2)
            num //= 2

        for i in range(3, int(sqrt(num))+1, 2):
            while(num % i == 0):
                s.add(i)
                num //= i

        if num > 1:
            s.add(num)

        return s

    def minJumps(self, nums: List[int]) -> int:
        n = len(nums)

        positions = {}
        for i, num in enumerate(nums):
            if num in positions:
                positions[num].append(i)
            else:
                positions[num] = [i]

        factors = {}
        for num in set(nums):
            factors[num] = self.getListOfFactors(num)

        q = deque([(n-1, 0)]) # indx, distance
        visited = [False]*n
        usedPrimes = set()

        visited[n-1] = True

        while(len(q)):
            node, distance = q.popleft()

            if node == 0:
                return distance

            if node > 0 and not visited[node-1]:
                q.append((node-1, distance+1))
                visited[node] = True

            if node < n-1 and not visited[node+1]:
                q.append((node+1, distance+1))
                visited[node] = True

            # print('node: ', node)
            # print('primes[nums[node]]: ', primes[nums[node]])

            for prime in factors[nums[node]]:
                if prime in usedPrimes:
                    continue
                usedPrimes.add(prime)
                for pos in positions[prime]:
                    if not visited[pos]:
                        q.append((pos, distance+1))
                        visited[pos] = True

        return -1
